import * as React from 'react';
import { View} from 'react-native';
import { Button, TextInput } from 'react-native-web';
import { Header,Container,Title,TitleLeft,HeaderButtonLeft,HeaderButtonRight} from './styles';
import { Entypo } from '@expo/vector-icons';

import {Icon} from '@expo/vector-icons/MaterialIcons';


function BreakfastScreen({navigation}) {
  return (
    <View>
      <Header>
        <HeaderButtonLeft>
        <Icon
          name="arrow-back-ios"
          size="28"
          color={COLORS.white}
          onPress={navigation.goBack}
        />
        </HeaderButtonLeft>
        <HeaderButtonRight>
          <Entypo name="dots-two-horizontal" size={20} color="#1D1617" />
        </HeaderButtonRight>
        <Title>Breakfast</Title>
      </Header>
      <Container>
        <div className="App">
          <input type="text" placeholder="Search Pancake" />
        </div>
       
        <TitleLeft>Category</TitleLeft>
        <Button
          title="Go to Bluebarry Pancake"
          onPress={() => navigation.navigate('Bluebarry Pancake')}
        />
      </Container>
    </View>
  );
}
export default BreakfastScreen;
